const Header = (props) => {
    return (
      <div>
        <h1>{props.courseName}</h1>
      </div>
    )
}

const Part = (props) => {
  return (
    <div>
      <p>
        {props.name} {props.numExercises}
      </p>
    </div>
  )
}

const Content = (props) => {
  return (
    <div>
      <Part name={props.name1} numExercises={props.numExercises1}/>
      <Part name={props.name2} numExercises={props.numExercises2}/>
      <Part name={props.name3} numExercises={props.numExercises3}/>
    </div>
  )
}

const Total = (props) => {
  return (
    <div>
      <p>
      Number of exercises {props.numExercises1 + props.numExercises2 + props.numExercises3}
      </p>
    </div>
  )
}

const App = () => {
  const course = 'Half Stack application development'


  const part1 = {
    name: 'Fundamentals of React',
    exercises: 10
  }
  const part2 = {
    name: 'Using props to pass data',
    exercises: 7
  }
  const part3 = {
    name: 'State of a component',
    exercises: 14
  }

  return (
    <div>
      <Header courseName={course}/>
      <Content name1={part1.name} numExercises1={part1.exercises} name2={part2.name}
      numExercises2={part2.exercises} name3={part3.name} numExercises3={part3.exercises}/>
      <Total numExercises1={part1.exercises} numExercises2={part2.exercises} numExercises3={part3.exercises}/>
    </div>
  )
}

export default App
